import React from "react";
import { BrowserRouter as Router, Route, Routes, Switch  } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js"; // for dropdowns and other JS components
import Header from "./components/Header";
import Posts from "./components/Posts";
import Page from './components/Page'; // Import the Page component

const App = () => {
  return (
    <Router>
      <Header />
      <Switch>
        {/* Add a Route for each page */}
        <Route exact path="/" render={() => <Page slug="home" />} />
        <Route exact path="/about" render={() => <Page slug="about" />} />
        <Route exact path="/contact" render={() => <Page slug="contact" />} />
        {/* Add more routes for other pages */}
      </Switch>
      <Posts/>
    </Router>
  );
};

export default App;
